import React from "react";
import {Link} from "react-router-dom";
import NavLinks from "./NavLinks";

function Nav() {
    return (
        <nav className="h-20 w-screen bg-gray-300 flex justify-center shadow-lg">

            <div className="w-5/6 h-full">

                <NavLinks />

            </div>
        </nav>
    );
}

export default Nav;
